review:
요즘 다들 이런류의 스타일을 입으시는걸 많이봐서 저도 구매했는데요.
핏도 예쁘고 좋은데 다만 단추가 너무 커서 끼우는 부분이 불편하네요;
다른 부분은 만족합니다~

예전에 샀던 제 옷을 보고 동생이 하나 장만해 달라해서 구매했습니다.
겨울에 내피로 입기도 좋고, 봄이나 가을 저녁처럼 일교차 많이 나는 날에 걸치고 나가면 좋아요
세탁법 준수하면 괜찮은데 이전에 건조기 고온으로 돌렸다가 살짝 색이 빠지긴 했는데 제 과실이라^^;

영케이 옷 따라 샀습니다.
크게 기대하지 않았는데 핏도 정말 예쁘고 무엇보다 얇은데 따뜻합니다.
아무데나 막 입기도 좋아요 추천합니다&gt;.&lt;
